import React, {Fragment} from "react";
import { Redirect } from 'react-router-dom'
import { connect } from 'react-redux'

class Dashboard extends React.Component{
    render(){
        return (
            <Fragment>
                <form onSubmit={this.handleSubmit} className='form'>
                <p className='field half'>
                    <select className='select' name="location" id='select'>
                    <option value='' selected disabled>Choose Sport:</option>
                    {this.props.currentUser.user.data.attributes.activities.map(sport => <option value={`${sport.name}`}>${sport.name}</option>)}
                    </select>
                </p> 
                </form>
                <div className="main">  
                <p>Yo</p>
                </div>
            </Fragment>
        );
    }
}

function msp(state){
    return {
        currentUser: state.userReducer.currentUser
    }
}

export default connect(msp)(Dashboard)
